0),(2160,'अनुकूलित (optimized) नहीं','hi',0,0,0,0),(2161,'OpenID की गणित लायब्रेरी','hi',0,0,0,0),(2162,'@module मॉड्यूल लापता है, तो निम्नलिखित मॉड्यूल अक्षम किया जाएगा: @depends.','hi',0,0,0,0),(2163,'@module मॉड्यूल लापता है, तो निम्नलिखित मॉड्यूल अक्षम किया जाएगा: @depends.','hi',2162,1,0,0),(2164,'मशीन पठनीय नाम ना ही \"जोड़ें\" या इनकी  ना ही \"सूची\" की जा सकती है.','hi',0,0,0,0),(2165,'इस सामग्री प्रकार के लिए बहुभाषीय समर्थन सक्षम करें. यदि सक्षम है, तो एक भाषा का चयन फ़ील्ड संपादन के फार्म के लिए जोड़ा जाएगा, जो आपको <a href=\"!languages\"> सक्षम भाषाओं में से एक </a> का चयन करने के लिए अनुमति देता है. आप इस सामग्री प्रकार के लिए अनुवाद चालू कर सकते हैं, जो आपकी सामग्री को संस्थापित भाषाओं में से किसी भी भाषा मे अनुवाद करने देगा. यदि अक्षम किया, तो नए पोस्ट डिफ़ॉल्ट भाषा के साथ सहेजे जायेगे. इस विकल्प को बदलने की वजह से  मौजूदा सामग्री प्रभावित नहीं होगी.','hi',0,0,0,0),(2166,'क्वेरी नोड के उपयोग के लिए टैग की गई, लेकिन वहाँ कोई nid नहीं है. स्कीमा में node.nid ठीक करने के लिए विदेशी कुंजी जोड़ें.','hi',0,0,0,0),(2167,'आपका नोड लिस्टिंग क्वेरी एक नोड के उपयोग के लिए टैग क्वेरी में एक आधार तालिका के रूप में @ fallback का उपयोग कर रहा है. यह सुरक्षित नहीं हो सकता है और शायद काम भी नहीं करे. अपने स्कीमा में विदेशी कुंजी निर्दिष्ट करें node.nid में. ','hi',0,0,0,0),(2168,'अज्ञात फ़ील्ड: @field_name','hi',0,0,0,0),(2169,'%field: वहाँ केवल एक दशमलव विभाजक (@separator) होना चाहिए.','hi',0,0,0,0),(2170,'!title सक्षम करें','hi',0,0,0,0),(2171,'निर्धारित करें !title को  डिफ़ॉल्ट के रूप में','hi',0,0,0,0),(2172,'सक्रिय मॉड्यूल है: %modules','hi',0,0,0,0),(2173,'फ़ाइल %file प्रतिलिपि नहीं बनाई जा सकती है क्योंकि गंतव्य %destination अमान्य है. यह file_copy() के अनुचित उपयोग या एक लापता धारा आवरण (missing stream wrapper) के कारण हो सकता है.','hi',0,0,0,0),(2174,'फ़ाइल %file प्रतिलिपि नहीं बनाई जा सकती है क्योंकि यह मौजूद नहीं है.','hi',0,0,0,0),(2175,'फ़ाइल %file स्थानांतरित नहीं की  जा सकती है क्योंकि  गंतव्य %destination अमान्य है. यह file_move() के अनुचित उपयोग या एक लापता धारा आवरण (missing stream wrapper) के कारण हो सकता है.','hi',0,0,0,0),(2176,'फ़ाइल %file नष्ट नहीं की  जा सकती है क्योंकि यह एक मान्य यूआरआइ नहीं है. यह file_delete () के अनुचित उपयोग या एक लापता धारा आवरण (missing stream wrapper) के कारण हो सकता है.','hi',0,0,0,0),(2177,'मौजूदा निजी फ़ाइलें संग्रहीत करने के लिए एक स्थानीय फाइल सिस्टम पथ. यह द्रुपल द्वारा लिखने योग्य होना चाहिए और वेब पर सुलभ नहीं होना चाहिए. ऑनलाइन पुस्तिका देखें <a href=\"@handbook\">अधिक जानकारी निजी फाइलें को सुरक्षित करने के बारे में </a>.','hi',0,0,0,0),(2178,'करकाउ','hi',0,0,0,0),(2179,'प्रकार @entity_type की इकाई पर बंडल संपत्ति गुम.','hi',0,0,0,0),(2180,'फील्ड्स प्रकार (ओं) का उपयोग इनमे है','hi',0,0,0,0),(2181,'फील्ड्स लंबित है हटाए जाने के लिए.','hi',0,0,0,0),(2182,'(मॉड्यूल: !module)','hi',0,0,0,0),(2183,'साइट कार्यक्षमता बढ़ाएँ.','hi',0,0,0,0),(2184,'अनुरोधित पृष्ठ \"@path\" पाया नहीं गया.','hi',0,0,0,0),(2185,'फार्म पुराना हो गया है. कॉपी करे नीचे के बिना सहेजे काम को और तब <a href=\"@link\"> इस पृष्ठ पुनः लोड करें </a>.','hi',0,0,0,0),(2186,'आप को कई निर्णय करने की आवश्यकता होगी इससे पहले आप सामग्री, टिप्पणी, आदि के लिए क्षेत्र (field)  को परिभाषित करे.','hi',0,0,0,0),(2187,'Throbber प्रदर्शन अपलोड की स्थिति नहीं दिखाता, लेकिन कम जगह लेता है. प्रोग्रेस बार उपयोगी है बड़े अपलोड  की प्रगति पर निगरानी के लिए.','hi',0,0,0,0),(2188,'डोमेन नाम इस भाषा के लिए उपयोग करने के लिए अगर URL डोमेन  <em>पहचान और चयन</em> के लिए उपयोग किया जाता है. तो डिफ़ॉल्ट भाषा के लिए खाली छोड़ें. <strong>इस मान को बदलने से  मौजूदा यूआरएल टूट जायेगे.</strong> उदाहरण के लिए: जर्मन के लिए भाषा डोमेन के रूप में \"de.example.com\" निर्दिष्ट करने से \"http://de.example.com/contact\" की तरह एक URL में परिणाम देगा.','hi',0,0,0,0),(2189,'अमान्य पहचानकर्ता %invalid_identity के लिए एक नई OpenID पहचानकर्ता  %identity को प्रतिस्थापन(replacement) के रूप जोड़ा गया है. अमान्य OpenID संक्रमण प्रक्रिया को समाप्त करने के लिए, कृपया अपने <a href=\"@openid_url\"> OpenID पहचान पृष्ठ </a> पर जाए और पुराने पहचानकर्ता % invalid_identity को हटा दें.','hi',0,0,0,0),(2190,'वहाँ पहले से ही एक खाता मोजूद है इस OpenID पहचानकर्ता के साथ जो आपने प्रदान किया है. हालांकि, प्रमाणीकरण प्रणाली के पिछले संस्करण में एक बग के कारण हम यह सुनिश्चित नहीं किया जा सकता है कि यह खाता आपसे सम्बन्ध रखता है. यदि आप इस साइट पर नए हैं, तो कृपया नया उपयोगकर्ता खाता दर्ज जारी रखे. यदि आपने पहले से ही इस साइट पर OpenID पहचानकर्ता के साथ जुड़ा एक खाता पंजीकृत किया है, तो कृपया प्रयास करें <a href=\"@url_password\"> पासवर्ड रीसेट</a> या साइट व्यवस्थापक से संपर्क करे.','hi',0,0,0,0),(2191,'खोज अनुक्रमणिका साफ़ नहीं है, लेकिन नई सेटिंग्स को प्रतिबिंबित करने के लिए व्यवस्थित अपडेट किया जाता है. खोज काम कारता रहेगा लेकिन नई सामग्री को अनुक्रमित (indexing) नहीं किया जाएगा जब तक सभी मौजूदा सामग्री को पुनः अनुक्रमित(re -indexing) नहीं कर लिया जाता, यह कार्य पूर्ववत नहीं हो सकता.','hi',0,0,0,0),(2192,'सक्रिय खोज मॉड्यूल','hi',0,0,0,0),(2193,'दोनों मौजूदा उपयोगकर्ता नाम और पासवर्ड को नष्ट करने के लिए इसे रिक्त छोड़ दें.','hi',0,0,0,0),(2194,'पासवर्ड बदलने के लिए, नया पासवर्ड दर्ज यहाँ करें.','hi',0,0,0,0),(2195,'HTTP प्रमाणीकरण क्रेडेंशियल्स को एक पासवर्ड के अलावा एक उपयोगकर्ता नाम को शामिल करना होगा.','hi',0,0,0,0),(2196,'Drupal कोर के इस संस्करण के साथ असंगत है.','hi',0,0,0,0),(2197,'क्रॉन अपडेट और खोज के लिए सामग्री, इंडेक्सिंग के लिए जाँच जैसे आवधिक कार्य चलाने का ख्याल रखता है.','hi',0,0,0,0),(2198,'साफ यूआरएल परीक्षण सफल रहा.','hi',0,0,0,0),(2199,'साफ़ यूआरएल सक्षम हैं, लेकिन साफ यूआरएल परीक्षण में विफल रहा है. साफ यूआरएल अक्षम करने के लिए नीचे दिए गए बॉक्स को अनचेक करें.','hi',0,0,0,0),(2200,'साफ यूआरएल परीक्षण में विफल रहा है.','hi',0,0,0,0),(2201,'उपयोगकर्ता नाम और पासवर्ड','hi',0,0,0,0),(2202,'उपयोगकर्ता मॉड्यूल खाते के फार्म के तत्व.','hi',0,0,0,0),(2203,'क्षेत्र %label बनाने में समस्या थी: !message','hi',0,0,0,0),(2204,'@module ( Drupal कोर के इस संस्करण<span class=\"admin-missing\"> के साथ असंगत</span>)','hi',0,0,0,0),(2205,'आपकी खोज में कई और/या अभिव्यक्ति का इस्तेमाल किया गया है. केवल पहली @count शब्द इस खोज में शाम